import { useParams } from "react-router-dom";
import useFetch from "./useFetch";


const BlogDetails
    = () => {

        const { id } = useParams();
        const { data, isPending, error } = useFetch('http://localhost:8000/blogs/' + id)

        return (
            <div className="blog-details">
                <h2>{data}</h2>
            </div>
        );
    }

export default BlogDetails
    ;
